close all
clearvars -except mapCD
load RawData\'1T-TaS2(point defect)'\lattCoord.mat
addpath myFunction\myftn\
fn = 'RawData\1T-TaS2(point defect)\mapCD.mat';
loadif(fn); %[output:7ff175ef] %[output:63ae6676] %[output:535e415f]
%%
%[text] ## Test the floating error of fft
f1 = figure(1) %[output:17cc55a1] %[output:14ae035e]
figure(1).Visible %[output:4c6e504a]
Z = mapCD.dt(2).Z;
Zr = ifft2(fft2(Z));
subplot(1,2,1) %[output:14ae035e]
views(Z) %[output:14ae035e]
title('Z') %[output:14ae035e]
colormap gray %[output:14ae035e]
subplot(1,2,2) %[output:14ae035e]
views(Zr) %[output:14ae035e]
title('ifft(fft(Z))') %[output:14ae035e]
colormap gray %[output:14ae035e]
sgtitle('Test the floating error of fft') %[output:14ae035e]
% annotation("textbox", [0.4397 0.8497 0.1 0.1], "String", "dddd")
%%

%%
%[text] ## Test the floating error of fft 2
f2 = figure(2) %[output:37dec3c9] %[output:6a55484c]
noise = Z-Zr;
views(noise) %[output:6a55484c]
title('Z - ifft(fft(Z))') %[output:6a55484c]
SNR = mean(mean(Z))/std(noise(:)) %[output:7aab6815]
%%
%[text] ## Masked FFT filter
%[text] ### Cal
fZ = fft2(Z);

%[text] ### graphic
f_maskedFFT = figure(3);
f= f_maskedFFT;
msb = 2;
nsb = 3;
p = 0;
for isb = 1:msb %[output:group:5973198b]
    for jsb = 1:nsb
        p = p + 1;
        sbs(isb,jsb)=subplot(msb,nsb,p) %[output:9521c7c4] %[output:861889d7] %[output:73d507a0] %[output:355b8448] %[output:0e18e2e7] %[output:0d79374f] %[output:767f3ef5]
    end
end %[output:group:5973198b]
sgtitle('filtered FFT') %[output:767f3ef5]
%[text] #### real space raw
f.CurrentAxes = sbs(1,1) %[output:1623eccd]
views(Z) %[output:767f3ef5]
colormap(gray) %[output:767f3ef5]

%[text] #### reciprocal space
f.CurrentAxes = sbs(1,2) %[output:7ba32cfc]
views(abs(fZ)) %[output:767f3ef5]
clim([0 .2]) %[output:767f3ef5]
%%
f.Visible ="on" %[output:5a55c13a] %[output:939cb6cf]
% real(fZ)
% % f2.Visible ="on"
%%
% max(abs(fZ),[],'all')
% min(abs(fZ),[],'all')
% histogram(abs(fZ))
%%
fZ %[output:75631e10]


